import React from "react";
import Experience from "../components/Experience";
import "./Home.css"; // Assuming you have this or adjust accordingly

const Home = () => {
  return (
    <main>
      <section id="hero">
        {/* Your existing hero section content */}
      </section>

      <section id="about">
        {/* Your existing about section content */}
      </section>

      <section id="projects">
        {/* Your existing projects section content */}
      </section>

      {/* Add the Experience section here */}
      <Experience />

      <section id="contact">
        {/* Your existing contact section content */}
      </section>
    </main>
  );
};

export default Home;
